import styled from 'styled-components'

const Container = styled.div`
  border: 1px solid grey;
  margin: 10em 10em 0 10em;
  display: flex;
  height: 400px;
  width: 700px;
  flex-direction: row;
  flex-wrap: wrap;
`

export default Container
